int main()
{
    int hours, minutes;
    cin >> hours >> minutes;

    int sumMinutes = hours * 60 + minutes + 15;
    int totalHours = sumMinutes / 60 % 24;
    int totalMinutes = sumMinutes % 60;

    if (totalMinutes < 10)
    {
        cout << totalHours << ":0" << totalMinutes << endl;
    }
    else
    {
        cout << totalHours << ':' << totalMinutes << endl;

    }
    
    return 0;
}

