double power(double x, int n) {
	/*double x = ;
	int n = ;*/
	
	if (n == 0)
		return 1;
		
	double y = 1;
	while (n < 0) {
		y /= x;
		n++;
	}
	while (n > 0) {
		y *= x;
		n--;
	}
	//return pow(x, n);
	return y;
}

double power2(double x, int n) {
	double y = 1;
	if (n < 0) {
		n = -n;
		x = 1 / x;  // x = x / 2  --> x /= 2
	}
	while (n > 0) {
		y *= x;
		n--;
	}
	//return pow(x, n);
	return y;
}

