namespace RobotKrytoi
{
    internal class Program
    {
        static void Main(string[] args)
        {
            double eurBalance = 100;
            double rubBalance = 10000;
            double eurExchangeRate = 100;

            Console.WriteLine($"Привет. У тебя есть {eurBalance} евро и {rubBalance} рублей");
            bool isContinue = true;
            while (isContinue == true)
            {

                Console.WriteLine($"Выбери тип конвертации: ");
                Console.WriteLine($"[1] - EUR -> RUB: ");
                Console.WriteLine($"[2] - RUB -> EUR: ");
                string userInput = Console.ReadLine();
                Console.WriteLine("Введите сумму: ");
                double inputValue = double.Parse(Console.ReadLine());

                switch (userInput)
                {

                    case "1":
                        isContinue = true;
                        rubBalance += inputValue * eurExchangeRate;
                        eurBalance -= inputValue;

                        break;

                    case "2":
                        isContinue = true;
                        eurBalance += inputValue / eurExchangeRate;
                        rubBalance -= inputValue;

                        break;

                }

                Console.WriteLine($"Теперь ваш евро баланс: {eurBalance} ");
                Console.WriteLine($"А баланс рублей: {rubBalance}");
                Console.WriteLine($"По курсу: 1 евро = {eurExchangeRate} рублей ");
                Console.Write("Желаете выйти из программы? [да][нет] ");
                userInput = Console.ReadLine();
                if (userInput == "да")
                {
                    isContinue = false;
                }
                else if (userInput == "нет")
                {
                    isContinue = true;
                    Console.WriteLine("Продолжаем...");
                    Console.WriteLine(" ");
                }
                else
                {
                    Console.WriteLine($"Вы ввели: {userInput}. Так неправильно.");
                }

                Console.ReadKey();
            }

        }
    }
}

